// import * as React from 'react';
import Button from '@mui/material/Button';
// import DeleteIcon from '@mui/icons-material/Delete';
// import SendIcon from '@mui/icons-material/Send';
// import Stack from '@mui/material/Stack';
// import swal from "sweetalert";
import { useDispatch, useSelector } from 'react-redux'
// import { addUser } from "./redux/Action";
// import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import {  useState } from 'react';
import { login } from '../api';
// import {navigate} from /navigate";
// import { useNavigate } from "react-router-dom";
// import { SetUser } from "./redux/Action";
// import { useState } from "react";
// import './style.css'

export const Login = () => {
    //     let emailRef=useRef()
    // let passwordRef=useRef()
    // let phoneRef=useRef()
    const [user, setUser] = useState({});
    const send = () => {
        login(user).then(x => {
            console.log(x.status);

        })
            .catch(x => {
                console.log("error");

            })
    }
    return <>
        <div className='login'>
            <h2 id="h4">כניסה</h2>
            <TextField id="outlined-basic" label=" הכנס אימייל" variant="outlined" onBlur={e => { setUser({ ...user, email: e.target.value }) }} />
            <p className="error"></p>
            <TextField id="outlined-basic" label=" הכנס סיסמה" variant="outlined" onBlur={e => { setUser({ ...user, password: e.target.value }) }} />
            <p className="error"> </p>
            <TextField id="outlined-basic" label=" הכנס  טלפון" variant="outlined" onBlur={e => { setUser({ ...user, phone: e.target.value }) }} />
            <p className="error"></p>
            <Button className='buto' variant="contained" onClick={send}>
                שליחה
            </Button>
        </div>

    </>
}
